<h2>开发</h2>
<p>上节课我们已经完成了登录部分的业务逻辑的开发，接下来我们需要实现的就是，当我们没有登录的情况下，我们需要控制我们的路由只能跳转我们的白名单页面，其他的页面一律自动跳转至登录页，然后在我们登录成功后，我针对性的跳转到对应的重定向地址部分。接下来我们一起来实现一下这一部分。
